('a', NULL, '2', NULL, 0, '陰性檢測'),
('a', '澳洲由各地方政府決定國內外旅客入境隔離檢疫條件，目前新南威爾斯州等其他各州及領地皆已開放接種2劑疫苗國際旅客(否則須申請醫療豁免)入境且免隔離，凡未接種疫苗而獲准入境者須隔離7日。', '3', NULL, NULL, '檢疫措施'),
('c', NULL, '1', '無相關限制', NULL, '符合入境者'),
('c', NULL, '2', NULL, 3, '陰性檢測'),
('c', '目的地為北京旅客，進行10天集中隔離+7天居家隔離。(但若在北京無固定居所、不具備居家隔離條件旅客則為14天集中隔離)\r\n目的地為外省市旅客，需進行14天集中隔離，14天隔離結束才可離開北京繼續前往其他省市。', '3', NULL, NULL, '檢疫措施'),
('f', NULL, '1', '無相關限制', NULL, '符合入境者'),
