('f', '', '2-2', '以完成接種疫苗者', 0, '陰性檢測'),
('f', '已施打疫苗旅客: 入境無需「必要理由」亦無需隔離；\r\n未施打疫苗旅客: 入境無需「必要理由」，需提供登機前72小時內PCR或48小時內抗原快篩檢測陰性報告，抵達後無需隨機進行檢測，且無需隔離；\r\n自本年2月12日起，已施打完整歐盟承認之疫苗(最後一劑施打日期未超過9個月)，並持證明的入境旅客，無需提供登機前檢測陰性報告。\r\n', '3', NULL, NULL, '檢疫措施'),
