('g', NULL, '2', NULL, 2, '陰性檢測'),
('g', '出具陰性檢測明、新冠肺炎康復證明或疫苗接種證明者，無須隔離。', '3', NULL, NULL, '檢疫措施'),
('hk', NULL, '1', '無特殊限制', NULL, '符合入境者'),
('hk', NULL, '2', NULL, 3, '陰性檢測'),
('hk', '1.預訂指定檢疫酒店7晚（如選擇符合條件後提早完成強制檢疫）或14晚（如選擇不提早完成強制檢疫）\r\n2.在機場接受檢測待行安排（包括PCR核酸檢測及快速抗原測試）、由指定車輛送指定檢疫酒店、接受強制檢疫7或14天', '3', NULL, NULL, '檢疫措施'),
('j', NULL, '1', '1.開放除觀光目的以外之短期停留、長期居留簽證申請。\r\n2.所有自外國入境日本者原則配合隔離檢疫7天，自台灣（因非屬於措施（17）所指定國・地區）入境日本者，得於入境後第3天自主性採檢，回報結果為陰性並獲復確認者得解除隔離檢疫。如已接種第3劑疫苗並滿足疫苗種類等相關條件者，入境後無須隔離檢疫。', NULL, '符合入境者'),
('j', NULL, '2', NULL, 3, '陰性檢測'),
('j', '皆須於機場接受PCR檢測\r\n未完成接種加強劑(3)疫苗者：\r\n於居家隔離之第3天自主檢測，向健康確認中心提交陰性報告，核可後即可解除隔離。如不於第3天自主檢測，需居家隔離7天。\r\n已完成接種加強劑疫苗者：不須隔離。', '3', NULL, NULL, '檢疫措施'),
('k', NULL, '1', '1.韓國公民、永久居民、配偶和直系親屬。\r\n2.持 APEC 商務證件。\r\n3.持韓國外國人登錄證者且具重新入境許可證（外交官 A-1、政府官員 A-2 及協議 A-3、在外同胞 F-4 類型除外）。\r\n4.E-9（就業許可證）卡持有人且須具「自我隔離確認 E9」表格。\r\n5.針對可免簽入境之外國人實施電子旅行許可制度(K-ETA)，目前開放 50 個國家和地區之旅客及 61 個暫緩免簽入境國(包括台灣)之優先入境商務人士。旅客須於搭機前 24 小時以上完成線上申請，有效期為批准日起 2 年，且於線上徵收手續費(韓幣 1 萬元)。', NULL, '符合入境者'),
('k', NULL, '2', NULL, 2, '陰性檢測'),
('k', '所有旅客需檢疫隔離 7 天\r\n韓國公民、長期簽證持有者：自我隔離\r\n短期簽證持有者：指定設施隔離\r\n2022 年 3 月 21 日起，符合下列條件者可免隔離：\r\n(1) 韓國境內完整接種->自動登錄接種證明\r\n(2) 海外完整接種->須向韓國衛生站提交接種證明\r\n(3) 自高風險國家來的旅客仍須隔離', '3', NULL, NULL, '檢疫措施'),
('s', NULL, '1', '無相關限制', NULL, '符合入境者'),
('s', NULL, '2-1', '已完成接種疫苗者', 0, '陰性檢測'),
('s', NULL, '2-2', '未完成接種疫苗者', 2, '陰性檢測'),
('s', '已完成疫苗接種者，不須進行入境檢測亦不需隔離，即可自由活動。\r\n未完成疫苗接種者，入境後須另進行7天居家檢疫隔離措施，並在結束前進行PCR檢測', '3', NULL, NULL, '檢疫措施'),
('sp', NULL, '1', '開放歐盟國家、英國等及歐盟建議安全國家(如我國)之公民入境。', NULL, '符合入境者'),
('sp', NULL, '2', NULL, 3, '陰性檢測'),
('sp', '抵達時將進行 PCR 測試，並需要隔離 10 天。\r\n旅客將在第 3 天、第 5 天和第 7 天在家接受快速檢測，並在第 10 天進行額外的 PCR 檢測。檢測呈陰性的人將需要遵循 7 天和第 3 天的自我健康管理期，以及第 6 天將在家裡進行快速檢測。', '3', NULL, NULL, '檢疫措施'),
('sw', NULL, '1', '無相關限制', NULL, '符合入境者'),
('sw', NULL, '2', NULL, 0, '陰性檢測'),
('sw', '自2月17日零時起，取消邊境實施的檢疫措施，因此，不再需要出示任何疫苗接種證書、康復證明、陰性篩檢或入境表格。', '3', NULL, NULL, '檢疫措施'),
('u', NULL, '1', '1. 美國公民、永久居民，包括其配偶、父母、法定監護人、兄弟姐妹（未婚、21歲以下）\r\n2. 外國政府官員（或直系親屬）\r\n3. 美國軍事人員及其配偶和子女\r\n4. 持電子旅遊許可ESTA或有效簽證之旅客 ( 需備有續回程機票 )', NULL, '符合入境者'),
('u', NULL, '2', '所有2歲以上之旅客皆須出示航班起飛前1日內新冠病毒陰性英文版報告(合格醫療院所/PCR核酸/快篩檢測)，或出發前90天內之COVID-19康復證明。\r\n', 1, '陰性檢測'),
('u', '已完整接種疫苗者：3-5d接受病毒測試並自我監測\r\n未完整接種疫苗者：3-5d接受病毒測試，7d家中自主隔離\r\n未完整接種、無接受病毒測試者：10d家中自主隔離\r\n', '3', NULL, NULL, '檢疫措施'),
('uk', NULL, '1', '無相關限制', NULL, '符合入境者'),
('uk', NULL, '2', NULL, 0, '陰性檢測'),
('uk', '英國將自3月18日(星期五)凌晨四點起取消所有 #COVID19 入境限制規定。自3月18日凌晨四點起 (英國時間)，所有入境英國的旅客都不再需要在入境前填寫旅客追蹤表格，也不需要進行任何入境前或入境後的病毒檢測。', '3', NULL, NULL, '檢疫措施');

